import React from 'react';

const FeedbackTable = () => {
  // Sample data array to populate the table
  const data = [
    {
      registerNumber: '12345',
      category: 'General',
      heading: 'Noise Complaint',
      summary: 'Loud noises from the room next door.',
    },
    {
      registerNumber: '23456',
      category: 'Maintenance',
      heading: 'Broken Light',
      summary: 'The light in the hallway is not working.',
    },
    {
      registerNumber: '34567',
      category: 'Food Services',
      heading: 'Food Quality',
      summary: 'The food served is cold and tasteless.',
    },
    // Add more data as needed
  ];

  // Inline styles
  const styles = {
    container: {
      width: '100%',
      maxWidth: '800px',
      margin: '20px auto',
      padding: '20px',
      backgroundColor: '#f9f9f9',
      borderRadius: '8px',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    },
    title: {
      textAlign: 'center',
      fontSize: '24px',
      color: '#333',
      marginBottom: '20px',
    },
    table: {
      width: '100%',
      borderCollapse: 'collapse',
      textAlign: 'left',
    },
    th: {
      padding: '12px 15px',
      backgroundColor: '#007bff',
      color: '#fff',
      fontWeight: 'bold',
      border: '1px solid #ddd',
    },
    td: {
      padding: '12px 15px',
      border: '1px solid #ddd',
    },
    evenRow: {
      backgroundColor: '#f2f2f2',
    },
    hoverRow: {
      cursor: 'pointer',
    },
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Feedback Table</h1>
      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.th}>Register Number</th>
            <th style={styles.th}>Category</th>
            <th style={styles.th}>Heading</th>
            <th style={styles.th}>Summary</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr
              key={index}
              style={index % 2 === 0 ? styles.evenRow : null}
              onMouseEnter={(e) => e.currentTarget.style.backgroundColor = '#e0e0e0'}
              onMouseLeave={(e) => e.currentTarget.style.backgroundColor = index % 2 === 0 ? '#f2f2f2' : 'transparent'}
            >
              <td style={styles.td}>{item.registerNumber}</td>
              <td style={styles.td}>{item.category}</td>
              <td style={styles.td}>{item.heading}</td>
              <td style={styles.td}>{item.summary}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default FeedbackTable;
